    <script>
        // Basic hover effect for the image
        document.querySelectorAll('img').forEach(img => {
            img.addEventListener('mouseover', () => {
                img.classList.add('shadow-glow-purple');
            });
            img.addEventListener('mouseout', () => {
                img.classList.remove('shadow-glow-purple');
            });
        });

        // Add a subtle animation to the background gradient as well if needed for more dynamism
